function g(c,o,t,n){console.log(c,o,t,n);const r=[c,t],e=[new Date(o),new Date(n)];return console.log(e),f(r,e)*100}function f(c,o){const t=r=>c.reduce((e,u,l)=>e+u/Math.pow(1+r,(o[l]-o[0])/31536e6),0);let n=.1;for(let r=0;r<100;r++){const e=t(n);if(Math.abs(e)<1e-6)return n;const u=c.reduce((l,s,p)=>l-s*(o[p]-o[0])/(1e3*60*60*24*365)/Math.pow(1+n,(o[p]-o[0])/(1e3*60*60*24*365)+1),0);n-=e/u}return n}export{g as c};
